import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Navbar from "./navpages/navbar";
import Home from "./navpages/home";
import Profile from "./navpages/profile"; // Fix the import path
import User from "./navpages/signup-user";
import Mech from "./navpages/signup-mech";
import Login from "./navpages/login.jsx";
import LineGradient from "./components/lineGradient";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Switch>
          <Route path="/home" exact component={Home} /> {/* Fix path */}
          <Route path="/profile" component={Profile} /> {/* Fix path */}
        </Switch>
      </Router>
      {/* <Home />
      <Profile />
      <User />
      <Mech />
      <Login /> */}
    </div>
  );
}

export default App;
